import React from 'react'
import {Link} from "react-router-dom"


function Header() {
    return (
        <nav>
            <h1>pBLS</h1>
            <h5>pretty BLS</h5>
            <Link to="/">Home</Link>
            <Link to="/about">About</Link>
        </nav>
    )
}

export default Header
